import { useLocation } from "react-router-dom";

export function plus(a, b) {
    return a + b;
  }

export function minus(a, b) {
return a - b;
}

export function multiply(a, b) {
return a * b;
}

export function divide(a, b) {
return a / b;
}

export function getLocUrl() {
    const location = useLocation();
    return location;
}
